description:
DJ FM's 2nd EP, &quot;Conversion Factor&quot; (2001), was an experiment in the more pop side of electronic music. Also the first recording to feature members of DJ FM's live band performing on an album! Remastered with hi-res album artwork...

All files are 320kbps, 44.1 sample rate, joint stereo mp3's

From FM:
&quot;All my music is available here for free, but if you'd also like to support me (i.e. rent, groceries, gas, etc), please visit my website and buy a track or two! Thanks always...peace and beats :) -FM&quot; 
